import React from 'react';
import Chips from '../Chips/Chips';

const Style = {
    picture: {
        height: 220
    },
    positAbsolute: {
        position: 'realtive'
    }
}

function Project(props) {
    return (
        <div className="myproject">
            <img 
                src={props.imgUrl} 
                alt="project" 
                style={Style.picture}/>
            <Chips style={Style.positAbsolute}/>
        </div>
    );
}

export default Project
